// 정적 데이터로서의 품목 그룹 리스트
const groupList = [
  {
    title: '동물 종류 선택',
    placeholder: '동물 종류',
    options: [
      { value: 'cat', label: '고양이' },
      { value: 'dog', label: '개' },
      { value: 'rabbit', label: '토끼' },
      { value: 'hamster', label: '햄스터' },
    ],
  },
  {
    title: '음식 선택',
    placeholder: '음식',
    options: [
      { value: 'cat-food-1', label: '고양이 사료 A' },
      { value: 'cat-food-2', label: '고양이 사료 B' },
      { value: 'dog-food-1', label: '강아지 사료 A' },
      { value: 'dog-food-2', label: '강아지 사료 B' },
      { value: 'rabbit-food-1', label: '토끼 사료 A' },
      { value: 'rabbit-food-2', label: '토끼 사료 B' },
      { value: 'hamster-food-1', label: '햄스터 사료 A' },
      { value: 'hamster-food-2', label: '햄스터 사료 B' },
    ],
  },
];

export default groupList;
